Este é o código Pix Copia e Cola para pagar a *fatura do PicPay Card*. 

| - - |

*Como pagar com Pix:*

1. Copie o código Pix;

2. Procure a opção *Pix Copia e Cola* no seu aplicativo de pagamentos e cole o código;

3. Digite exatamente o valor que você quer pagar e confirme;

Lembre-se que no período noturno existe um valor limite para pagamentos com Pix.

